import React ,{useContext}from 'react'
import {Link} from "react-router-dom"
import Search from './Search'
import {proContext} from "./Context"
import {ShoppingCart,House,CreditCard} from "phosphor-react"

export default function Nav() {
  const{TotalNum}=useContext(proContext)
  return (
    <div>
        <Link to="/"><House size={30} />店铺首页</Link>
        <Link to="/cart"><ShoppingCart size={30}/>购物车({TotalNum()})</Link>
        <Link to="/checked"><CreditCard size={30} />结账</Link>
        <Search/>
    </div>
  )
}
